    data: |
      SELECT + 21, col0 AS col0 FROM tab1 AS cor0 WHERE - col2 + 59 * + + col1 / 71 NOT IN ( - 76, + 95 * ( - col1 ) + col1, col1 / - col2, + 62, + 9 - CAST ( col1 AS INTEGER ) );
  - name: tab1

outputs:
  - name: q6105.out
    data: |
      21	51
      21	85
      21	91
